import Helmet from "react-helmet";

const Outreach = () => {
  return (
    <div>
      <div>
        Outreach
        <Helmet>
          <script src="https://apps.elfsight.com/p/platform.js" defer></script>
        </Helmet>
        <div class="elfsight-app-7f1a767f-4d2e-4be7-b1ca-25644e6c8a72"></div>
      </div>
    </div>
  );
};

export default Outreach;
